import React from "react";
import todoData from "../../data/todoData";
import TodoItem from "./todoItem";
{
  /* <TodoItem
attributes={{
  question: "What's up?",
  answer: "Your mom"
}}
></TodoItem>
<TodoItem
attributes={{
  question: "What's the matter?",
  answer: "Existential frustration"
}}
></TodoItem>
<TodoItem
attributes={{
  question: "When's dinner?",
  answer: ""
}}
></TodoItem> */
}
class ToDoCard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      todos: todoData
    };
  }
  render() {
    return (
      <div>
        {this.state.todos.map((item, i) => {
          return <TodoItem key={i} attributes={item}></TodoItem>;
        })}
      </div>
    );
  }
}
export default ToDoCard;
